std::ostream& operator<<(std::ostream& os, FileSystemType value) {
  switch(value) {
    case FileSystemType::kTemporary:
      return os << "FileSystemType::kTemporary";
    case FileSystemType::kPersistent:
      return os << "FileSystemType::kPersistent";
    case FileSystemType::kIsolated:
      return os << "FileSystemType::kIsolated";
    case FileSystemType::kExternal:
      return os << "FileSystemType::kExternal";
    default:
      return os << "Unknown FileSystemType value: " << static_cast<int32_t>(value);
  }
}

